【クルマの消臭力 クリップタイプ タバコ用スカイミントの詳細】<br>
●ペアリング消臭効果で、車内をまるごと消臭。快適な空間にします。<br>
●車内のエアコンの送風口に取り付けるだけで簡単。<br>
●リキッドタイプで使い終わりが分かりやすい。<br>
●約45日長持ちします、（季節や使用状況により異なります。）<br>
●香りの調節機能付きです。<br><br>

【使用方法】<br>
1.アルミシールを引っぱる。※ゆっくり引き抜く。液がこぼれる場合がある。<br>
2.本体に付属のクリップを取りつける。抜けないことを確認する。<br>
3.エアコン送風口に差し込む。※事故防止のため、簡単に外れないことを確認する。<br><br>

【ご注意】<br>
○容器を開けて中身を取り出さない。<br>
○脱落した場合でも運転の妨げにならない位置に固定する。<br>
○本品を装着するとルーバーの操作ができなくなる恐れがある。<br>
○オートスイングエアコン車は、スイングを止めた状態で使用する。<br>
○引火性があるので火気の付近で使用しない。<br>
○万一、内容物がこぼれた場合、シミやヒビ割れ等を起こす恐れがあるので、速やかに布などで拭き取る。<br>
○用途以外には使用しない。<br>
○使用中や保管の際に液色が変色することがあります。<br>
○飲用不可:人体に害があるので絶対に飲まない。<br>
○皮フに触れた場合、かぶれる恐れがあるので注意する。<br>
○幼児の手の届く所に置かない。<br><br>

【成分】<br>
香料、溶剤<br><br>

【内容量】<br>
3.2ml<br><br>

【販売元】<br>
エステー<br>
東京都新宿区下落合1-4-10<br>
お電話：03-3367-2120<br><br>

【商品区分】<br>
