【ファブリーズ 送風口用イージークリップ ダブル消臭 クリスタルシトラスの詳細】<br>
●100%香料オイルで、「食べ物」「ペット」「体臭」などのニオイに消臭効果を発揮。同時に爽やかな香りが広がります。（消臭・芳香は約30日間持続）また、つまみで 香りの強さも簡単に調整が可能です。<br>
●車内のエアコン送風口にワンタッチ装着するだけの簡単な使用法。どんな車内にも溶け込む、スタイリッシュかつコンパクトなデザインです。<br><br>

【使用方法】<br>
○始めに香りを放つためにパチンとはまるまでクリップをおこしきる。<br>
○香りを確認して、クリップをエアコン送風口に取り付ける。<br>
○香りの調節 つまみで香りの強さを調整する。<br><br>

【ご注意】<br>
○用途以外に使用しない。<br>
○中身を取り出さない。<br>
○火気の付近で使用しない。<br>
○脱落した場合でも運転の妨げにならない位置に固定する。<br>
○車種によりクリップで挟むことができない場合があります。<br>
○直射日光の当たるところや、温度が60度を超えるところでの使用はしない。<br>
○香料によってはオイルが黄色くなることがありますが、品質に問題はありません。<br>○製品の成分が目や、肌、服につかないように注意する。<br>
○消臭成分や香りが出てくる穴をのぞきこんだり、指で押さえたりしない。<br>
○本品は食べられません。<br>
○本品はおもちゃではありません。<br>
○万一香料オイルがこぼれた場合はすぐにふき取る。内装を損傷する可能性があります。<br>
○子供やペットの手が届かないところに製品を保管、設置する。<br>
○この製品は使い捨てです。<br>
○保管の際は、直射日光の当たるところ、40度以上になるところに置かないでください。<br><br>

【成分】<br>
香料<br><br>

【内容量】<br>
2ml<br><br>

【販売元】<br>
P＆G<br>
