●上質な香りと確かな消臭力：洗練された上質な香りと、確かな消臭力で車内を癒し空間へ。<br>
●香り調節機能でお好みの演出を：気分や好みに応じて、香りの強さを調節できます。<br>
●消臭力と香りが70日間継続：上質な香りと消臭力は、70日間も持続します。<br><br>

【使用方法】<br>
1.キャップをはずす<br>
2.本体ケースにセット、「カチッ」とはまるまで（ガラスボトルの膨らみが手前）<br>
3.エアコン送風口に取り付ける<br><br>

【ご注意】<br>
○用途以外に使用しない<br>
○中身を取り出さない<br>
○火気の付近で使用しない<br>
○脱落した場合でも運転の妨げにならない位置に固定する<br>
○車種によりクリップで挟むことができない場合があります。<br>
○直射日光の当たるところや、温度が60度を超えるところでの使用はしない<br>
○香料によってはオイルが黄色くなることがありますが、品質に問題はありません。<br>○製品の成分が目や、肌、服につかないように注意する<br>
○内容物がこぼれた場合はすぐに拭きとる<br>
○本品は食べられません。<br>
○本品はおもちゃではありません。<br>
○子供やペットの手が届かないところに製品を保管、設置する<br>
○つけかえは必ずファブリーズプレミアムクリップつけかえ用をご使用ください。<br><br>

